import React, { Component } from "react";

export const BookContext = React.createContext();

export class BookProvider extends Component {
    constructor(props) {
        super(props);

        this.state = {
            users: [{name: 'Linh', password: '12345'}]
        };
    }

    render() {
        return (
            <BookContext.Provider 
                value={{
                    users: this.state.users,
                    errors: 0
                }}
            >
                {this.props.children}
            </BookContext.Provider>
        )
    }
}
